import React, { Component } from "react";

export default class HomePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cart: [], // Cart items
      showCart: false, // Toggle cart modal
    };
  }

  // Add to cart
  handleAddToCart = (product) => {
    this.setState((prevState) => ({
      cart: [...prevState.cart, product],
    }));
  };

  // Remove from cart
  handleRemoveFromCart = (index) => {
    this.setState((prevState) => {
      const updatedCart = [...prevState.cart];
      updatedCart.splice(index, 1);
      return { cart: updatedCart };
    });
  };

  // Toggle cart view
  toggleCart = () => {
    this.setState((prevState) => ({ showCart: !prevState.showCart }));
  };

  render() {
    const { cart, showCart } = this.state;

    const products = [
      {
        id: 1,
        title: "Product 1",
        price: 500,
        image:
          "https://images.unsplash.com/photo-1542291026-7eec264c27ff?w=500&q=80",
      },
      {
        id: 2,
        title: "Product 2",
        price: 750,
        image:
          "https://images.unsplash.com/photo-1513708928624-9fa24a4b86d7?w=500&q=80",
      },
      {
        id: 3,
        title: "Product 3",
        price: 1200,
        image:
          "https://images.unsplash.com/photo-1567016547575-7c3b6b178bd8?w=500&q=80",
      },
    ];

    return (
      <div style={styles.container}>
        {/* 🔹 Header */}
        <header style={styles.header}>
          <h1 style={styles.title}>🛍 My E-Commerce Store</h1>
          <button onClick={this.toggleCart} style={styles.cartBtn}>
            🛒 Cart ({cart.length})
          </button>
        </header>

        {/* 🔹 Product Grid */}
        <div style={styles.grid}>
          {products.map((product) => (
            <div key={product.id} style={styles.card}>
              <img src={product.image} alt={product.title} style={styles.img} />
              <h3>{product.title}</h3>
              <p>₹{product.price}</p>
              <button
                onClick={() => this.handleAddToCart(product)}
                style={styles.button}
              >
                Add to Cart
              </button>
            </div>
          ))}
        </div>

        {/* 🔹 Cart Modal */}
        {showCart && (
          <div style={styles.cartBox}>
            <h2>Your Cart</h2>
            {cart.length === 0 ? (
              <p>No items in cart</p>
            ) : (
              <ul style={{ listStyle: "none", padding: 0 }}>
                {cart.map((item, index) => (
                  <li key={index} style={styles.cartItem}>
                    <img src={item.image} alt={item.title} style={styles.cartImg} />
                    <span>
                      {item.title} - ₹{item.price}
                    </span>
                    <button
                      onClick={() => this.handleRemoveFromCart(index)}
                      style={styles.removeBtn}
                    >
                      ❌ Remove
                    </button>
                  </li>
                ))}
              </ul>
            )}
          </div>
        )}
      </div>
    );
  }
}

// 🔹 Styles
const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    padding: 20,
  },
  header: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 30,
  },
  title: {
    fontSize: 28,
    fontWeight: "bold",
  },
  cartBtn: {
    padding: "10px 20px",
    background: "linear-gradient(90deg,#007bff,#00c6ff)",
    color: "#fff",
    border: "none",
    borderRadius: 8,
    cursor: "pointer",
    fontSize: 16,
  },
  grid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(250px, 1fr))",
    gap: 20,
  },
  card: {
    border: "1px solid #ddd",
    borderRadius: 12,
    padding: 20,
    textAlign: "center",
    background: "#fff",
    boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
  },
  img: {
    width: "100%",
    height: 180,
    objectFit: "cover",
    borderRadius: 10,
    marginBottom: 15,
  },
  button: {
    marginTop: 10,
    padding: "10px 15px",
    background: "#007bff",
    color: "#fff",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
  },
  cartBox: {
    position: "fixed",
    top: 80,
    right: 20,
    width: 350,
    background: "#fff",
    border: "1px solid #ddd",
    borderRadius: 12,
    padding: 20,
    boxShadow: "0 6px 20px rgba(0,0,0,0.2)",
    zIndex: 1000,
  },
  cartItem: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 10,
  },
  cartImg: {
    width: 50,
    height: 50,
    borderRadius: 8,
    marginRight: 10,
  },
  removeBtn: {
    background: "red",
    color: "#fff",
    border: "none",
    padding: "6px 10px",
    borderRadius: 6,
    cursor: "pointer",
  },
};
